public String getJSON() {
  final Map<String, String> info = new TreeMap<>();
  readLock.lock();
  try {
    for (Entry<ConnectionPoolId, ConnectionPool> entry :
        this.pools.entrySet()) {
      ConnectionPoolId connectionPoolId = entry.getKey();
      ConnectionPool pool = entry.getValue();
